        this.showModal = val;
        this.showDictionary();
      }
    },
    showModal: function showModal(val) {
      if (!val) {
        this.$emit('on-modal-change', '', val);
      }
    }
  },
  methods: {
    showDictionary: function showDictionary() {
      var _this = this;
      this.$store.dispatch('showDictionary', {
        params: {
          id: this.showForm.id
        }
      }).then(function () {
        _this.showForm = _this.dictionaryStore.item;
      });
    },
    handleOk: function handleOk() {
      this.handleCancel();
    },
    handleCancel: function handleCancel() {
      this.resetFields();
      this.showModal = false;
      this.showLoading = false;
    },
    resetFields: function resetFields() {
      this.$refs.showForm.resetFields();
    }
  }
};
